import React from "react";
import Course from "./components/course.component";





const course = {
  id: 1,
  name: 'Half Stack application development',
  parts: [
    {
      name: 'Fundamentals of React',
      exercises: 10,
      id: 1
    },
    {
      name: 'Using props to pass data',
      exercises: 7,
      id: 2
    }
  ]
}

const App = () => {

  return ( <Course course={course}/> )
}

export default App;
